import React from "react";

function ToDo({ key, task, completed, updateTask }) {
    const toDoStyle = {
        // color: 'green'
    };

    return (
        <div>
            {completed ? <p onClick={updateTask}>done</p> : <p onClick={updateTask}>not done</p>}
            <p>{task}</p>
        </div>
    );
};

export default ToDo;
